  [],\n\t\"revision_timestamp\": \"2016-07-26T20:09:23.701620\",\n\t\"name\": \"long-term-hydrological-radiological-site-monitoring-data\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Quality Data Asset includes all current
  and historical data on the quality of water with regard to the presence of water
  pollutants of all kinds regulated by the Clean Water Act. Under the new Interagency
  Agreement with the Department of Energy (DOE), the Radiation & Indoor Environments
  National Laboratory (R&IE), Office of Radiation and Indoor Air (ORIA), EPA, located
  in Las Vegas, NV, conducts a Long-Term Hydrological Monitoring Program (LTHMP) providing
  laboratory sampling/analysis and Quality Assurance and Control to measure radioactivity
  concentrations in the water sources near the sites of former underground nuclear
  explosions. The results of the LTHMP provide assurance that radioactive material
  from the tests have not migrated into water supplies.\",\n\t\"license_title\": \"Other
